  // // "nbs-aad-registration",
  // // "nbs-ansible-cloudwatch-agent",
  // "nbs-github-terraform",
  // "nbs-lz-ami-bakery",
  // // "nbs-lz-ami-bakery-aws-linux",
  // // "nbs-lz-es-shipper",
  // // "nbs-lz-log-receiver",
  // // "nbs-onboarding",
  // // "nbs-terraform-reports",
  // // "terraform-aws-elasticsearch",
  // // "terraform-aws-alb-native-ingress",
  // // "test-bk-repo",
